import React, { useRef, useState } from 'react'
 import IMG from "./RCB.jpg"
const App = () => {
    let [Img,setImg]=useState(IMG)
    let [loading,setLoading]=useState(true)
    let imgRef=useRef()
    let handleChange=()=>{
        if(loading===true){
            setLoading(!true)
            imgRef.current.style.borderRadius="25%"
            imgRef.curr
        }
    }
  return (
    <div>
  <img src={Img} ref={imgRef} alt="" height="200px" width="200px"/>
  <button onClick={handleChange}>{loading ? "ON" : "OF"}</button>
    </div>
  )
}

export default App
